import React from "react";
import { useLocation } from 'react-router-dom';

import { ContainerPage, TittlePage } from "../../components/Main";

const NivelamentoPage = () => {
    const location = useLocation();
    // Obter os dados do estado da localização
    const { dados } = location.state;

    return (
        <ContainerPage>
            <TittlePage>
                <div className="wc-text">Ótimo!<br /> Agora nos informe em que nível você se encontra em cada técnologia selecionada</div>
            </TittlePage>

            {/* Exibir os dados recebidos */}
            <div>
                <h1>Dados Nivelamento</h1>
                <p>Competências selecionadas: {dados.competencias.map(comp => comp.valor).join(', ')}</p>
                <p>Seleção do select: {dados.selectValue}</p>
            </div>
        </ContainerPage>
    );
}

export default NivelamentoPage;
